import React from 'react';
import { MDBBtn, MDBContainer } from 'mdb-react-ui-kit';
import './App.css';
import ExpenseList from './comonents/ExpenseItem';
import ExpenseForm from './comonents/ExpenseForm';
import Alert from './comonents/Alert';

function App() {
  return (
    <MDBContainer fluid>
      <div>Hello App</div>
      <ExpenseForm/>
      <ExpenseList/>
      <Alert/>
    </MDBContainer>
  );
}

export default App;
